import axios from 'axios';

const url = 'http://localhost:5000/posts';

export const fetchQuotes = () => axios.get(url);
export const createQuotes = (newPost) => axios.post(url, newPost);
export const deleteQuote = (id) => axios.delete('http://localhost:5000/posts/'+id);
